script: |
  super -f text -I q1996.spq | sort > q1996.out

inputs:
  - name: q1996.spq
    data: |
      SELECT - 35, - 21 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT + + col1 * ( + + 5 ) / - + 65 IS NULL;
  - name: tab0

outputs:
  - name: q1996.out
    data: |
      -35	-21
      -35	-21
      -35	-21
